public class Solution {
    public String[] findWords(String[] words) {
        List<String> result = new ArrayList<>();
        for (String word : words) {
            if (isValidWord(word)) {
                result.add(word);
            }
        }
        return result.toArray(new String[result.size()]);
    }

    private boolean isValidWord(String word) {
        int firstRow = getRow('q', 'w', 'e', 'r', 't', 'y', 'u', 'i', 'o', 'p');
        int secondRow = getRow('a','s', 'd', 'f', 'g', 'h', 'j', 'k', 'l');
        int thirdRow = getRow('z', 'x', 'c', 'v', 'b', 'n','m');

        int row = -1;
        for (char c : word.toLowerCase().toCharArray()) {
            if (row == -1) {
                row = getRow(c);
            } else if (getRow(c)!= row) {
                return false;
            }
        }
        return true;
    }

    private int getRow(char c) {
        switch (c) {
            case 'q':
            case 'w':
            case 'e':
            case 'r':
            case 't':
            case 'y':
            case 'u':
            case 'i':
            case 'o':
            case 'p':
                return 0;
            case 'a':
            case's':
            case 'd':
            case 'f':
            case 'g':
            case 'h':
            case 'j':
            case 'k':
            case 'l':
                return 1;
            case 'z':
            case 'x':
            case 'c':
            case 'v':
            case 'b':
            case 'n':
            case'm':
                return 2;
            default:
                throw new IllegalArgumentException("Invalid character");
        }
    }

    private int getRow(int... chars) {
        return chars[0] / ('a' - 'A') * 3 + chars[0] % ('a' - 'A');
    }
}
